import React from 'react'
import './Nav.css'
import {Link} from 'react-router-dom'
import { useMediaQuery } from 'react-responsive'
const Nav=()=>{
    const Example = () => {
        const isDesktopOrLaptop = useMediaQuery({ minDeviceWidth: 1224 })
        const isBigScreen = useMediaQuery({ minDeviceWidth: 1824 })
        const isTabletOrMobile = useMediaQuery({ maxWidth: 1224 })
        const isTabletOrMobileDevice = useMediaQuery({ maxDeviceWidth: 1224 })
        const isPortrait = useMediaQuery({ orientation: 'portrait' })
        const isRetina = useMediaQuery({ minResolution: '2dppx' })}
    return(
        <section className='navbar'>
            <div class='navbar1'>
                <a>HariCharan</a>
            </div>
            <div class='navbar2'>
            <a><Link to='/' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Home</Link></a>
<a><Link to='/About' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>About</Link></a>
<a><Link to='/Servive' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Servive</Link></a>
            </div>
            <div className='navbar3'>
                <input type='text' placeholder='Search'/>
            </div>
        </section>
    );
}
export default Nav;
